"""# **[Keypoint Detection-ufdatastudio/vit-pose](https://huggingface.co/ufdatastudio/vit-pose)**

![download.jpeg](data:image/jpeg;base64,)
"""

from transformers import ViTFeatureExtractor,ViTForImageClassification
from PIL import Image
import torch
import requests
from io import BytesIO

# Load the feature extractor and model
model_name = "ufdatastudio/vit-pose"
feature_extractor = ViTFeatureExtractor.from_pretrained(model_name)
model = ViTForImageClassification.from_pretrained(model_name)

img = Image.open("/content/download.jpeg").convert("RGB")

# Preprocess the image
inputs = feature_extractor(images=img, return_tensors="pt")

# Run inference (classify the image)
with torch.no_grad():
    outputs = model(**inputs)

# Get predicted class
predicted_class_idx = outputs.logits.argmax(-1).item()
labels = model.config.id2label  # get labels
predicted_label = labels[predicted_class_idx]

# Print the result
print(f"Predicted Label: {predicted_label}")

"""# **[Video Classification-Qwen/QwQ-32B-Preview](https://huggingface.co/Qwen/QwQ-32B-Preview)** "Crashed-Ram&Disk"
"""

from transformers import AutoModelForCausalLM, AutoTokenizer

model_name = "Qwen/QwQ-32B-Preview"

model = AutoModelForCausalLM.from_pretrained(
    model_name,
    torch_dtype="auto",
    device_map="auto"
)
tokenizer = AutoTokenizer.from_pretrained(model_name)

prompt = "How many r in strawberry."
messages = [
    {"role": "system", "content": "You are a helpful and harmless assistant. You are Qwen developed by Alibaba. You should think step-by-step."},
    {"role": "user", "content": prompt}
]
text = tokenizer.apply_chat_template(
    messages,
    tokenize=False,
    add_generation_prompt=True
)
model_inputs = tokenizer([text], return_tensors="pt").to(model.device)

generated_ids = model.generate(
    **model_inputs,
    max_new_tokens=512
)
generated_ids = [
    output_ids[len(input_ids):] for input_ids, output_ids in zip(model_inputs.input_ids, generated_ids)
]

response = tokenizer.batch_decode(generated_ids, skip_special_tokens=True)[0]